import React, {useContext} from 'react';
import {RegistrContext} from "../../RegistrContext";
import Article from "../Article/Article";


const News = () => {
    const { news } = useContext(RegistrContext);

    return (
        <div>
            {news.map(item => {
                return <Article
                    title = {item.sectionName}
                    webTitle = {item.content}
                    webUrl = {item.webUrl}
                />
            })}
        </div>
    );
};

export default News;

